import React from 'react'
import Axios from 'axios'

export default function Index() {

    const server = 'http://127.0.0.1:8000/'

    React.useEffect(() => {

        Axios.get(server + 'api/tenant')
            .then(res => {
                console.log(res)
            })
            .catch(err => {
                console.log(err)
            })
    })

    return (
        <div>
            <h2>Sample Test</h2>
        </div>
    )
}
